import {Card} from "react-bootstrap";
const Node = (props)=>{
    return (
      <Card
        style={{
          backgroundColor: "#34FF3B",
          height: 10,
          width: 10,
          borderRadius: 5,
          border: "none",
        }}
      >
        {props.children}
      </Card>
    );
}

export default Node;
